def fibonacci(n):
    """"""
    if n < 0:
        raise Exception('Input number must be positive')
    elif n == 0:
        return []
    elif n == 1:
        return [0]
    else:
        fib_seq = [0, 1]
        while fib_seq[-1] < n:
            fib_seq.append(fib_seq[-1] + fib_seq[-2])
        return fib_seq
